import React from 'react';
import styles from './Header.module.css';

const Header: React.FC = () => {
  return (
    <header className={styles.header}>
      <div className={styles.container}>
        <div className={styles.logo}>
          <img src="/images/logo.png" alt="Логотип" className={styles.logoImage} />
          <h1 className={styles.title}>Многофункциональный центр помощи международным перевозчикам</h1>
        </div>
        <nav className={styles.nav}>
          <a href="#services" className={styles.navLink}>Услуги</a>
          <a href="#promotions" className={styles.navLink}>Акции</a>
          <a href="#map" className={styles.navLink}>Контакты</a>
        </nav>
      </div>
    </header>
  );
};

export default Header;
